import React from 'react';
import { NavLink } from 'react-router-dom';
import 'whatwg-fetch';
import './../../config.js';

import Footer from './Footer';
import Nav from './Nav';
import swal from 'sweetalert2';

class Home extends React.Component {
  constructor(props) {
    super(props);

    this.closeCookie = this.closeCookie.bind(this);
    this.sendMessage = this.sendMessage.bind(this);

    this.state = {
      last_product       : [],
    };
  }

  closeCookie() {
    localStorage.removeItem('cookie');
    document.querySelector('.cookie').classList.add('d-none');
  }

  componentWillMount() {
    const me = this;
    let api = API(); // eslint-disable-line no-undef

    fetch(api.product.last, {
      headers: new Headers({'Content-Type': 'application/x-www-form-urlencoded'}),
      method: 'GET',
    })
      .then((response) => response.json())
      .then((response) => {
        let last_products = [];

        for (let i = 0; i < response.length; i++) {
          let last_product = response[i];

          last_products.push(
            <div className="col-12 col-lg-4" key={ '/product/'+ last_product.id }>
              <NavLink to={ '/product/'+ last_product.id }>
                <div className="row preview-product fadein">
                  <div className="col-12">
                    <div className="img">
                      { Object.keys(last_product).length >= 0 &&
                      <img src={ last_product.image } alt="Preview last product" />
                      }
                    </div>
                  </div>
                  <div className="col-12">
                    <div className="mt-4 text-center infos">
                      <p>{ last_product.name }</p>
                      <p>{ last_product.author }</p>
                      <p className="desc">{ last_product.description }</p>
                    </div>
                  </div>
                </div>
              </NavLink>
            </div>
          );
        }
        me.setState({ last_product: last_products });
      });
  }

  sendMessage() {
    swal({
      title: 'Envoyer un message',
      html:
      '<div class="container-fluid text-left">' +
        '<div class="row justify-content-center my-5">' +
          '<div class="col-12">' +
            '<div class="form-input">' +
              '<label class="mb-3">Indiquer votre mail</label>' +
              '<input id="mail" type="text" class="form-control" name="mail" placeholder="Ex: john.doe@exemple.fr" />' +
            '</div>' +
          '</div>' +
        '</div>' +
        '<div class="row justify-content-center my-5">' +
          '<div class="col-12">' +
            '<div class="form-input">' +
              '<label for="company" class="mb-3">Indiquer votre message</label>' +
              '<textarea id="message" class="form-control" name="message" placeholder="Votre message ici"></textarea>' +
            '</div>' +
          '</div>' +
        '</div>' +
      '</div>'
      ,
      showCancelButton: true,
      confirmButtonText: '✔ Envoyer',
      cancelButtonText: 'Retour'
    }).then(e => {
      if(e.value && document.querySelector('#message').value.length > 0 && document.querySelector('#mail').value.length > 0) {
        swal({
          title: 'Message envoyé !',
          text: 'Nous avons bien reçu ton message, nous y répondrons aussi vite que possible ! :)',
          type: 'success',
          confirmButtonText: '✔ Ok',
        });
      }
    });
  }

  render() {
    const me = this;
    let last_product = me.state.last_product;

    return (
      <section id="Home">
        <Nav/>
        <div className="container-fluid blockheader">
          <div className="row">
            <div className="col-12">
              <h1>inkrest</h1>
              <p>Bienvenue sur inkrest, faites vos propres modèles où utilisez les nôtres !</p>
            </div>
          </div>
          <div className="row justify-content-center blockoverflow">
            <div className="col-12">
              <div className="row mb-5">
                <div className="col-12">
                  <div className="p-5">
                    <h4>Dernière publication</h4>
                    <p className="mt-4">
                      Voici la dernière publication en date de la part d{'\''}un membre de la communauté !
                    </p>
                    <div className="row mt-5">
                      { last_product }
                    </div>
                  </div>
                </div>
                <div className="col-12 text-center">
                  <NavLink to="/products" className="btn btn-white fadein">
                    Voir plus de produits
                  </NavLink>
                </div>
              </div>
              <div className="row mb-5 section">
                <div className="col-12 col-lg-6 rocket-img">
                  <img src="data:image/png;base64,
" alt="Creation ad"/>
                </div>
                <div className="col-12 col-lg-6">
                  <div className="p-5 section-infos">
                    <h4>Propulsez-vous et ajoutez vos créations !</h4>
                    <p className="mt-4">
                      Dans cette section, vous allez être guidé étape par étape pour publier vos créations et ainsi les proposer à notre communauté !
                      Pas d{'\''}inquiétudes, vos créations sont protégées par vos droits d{'\''}auteurs et notre législation !
                    </p>
                    <p className="mt-4">Lancez-vous !</p>
                    <div className="text-center mt-5">
                      <NavLink to="/creation" className="btn btn-white fadein">
                        Ajouter ma création
                      </NavLink>
                    </div>
                  </div>
                </div>
              </div>
              <div className="row mb-5 section">
                <div className="col-12 col-lg-6">
                  <div className="p-5 section-infos">
                    <h4>inkrest dans l{'\''}histoire</h4>
                    <p className="mt-4">
                      inkrest n{'\''}est qu{'\''}une infime partie de tout ce qui a pu se passer avant que vous n{'\''}arriviez sur ce site. Vous êtes l{'\''}avenir de celle-ci mais connaissez vous son passé ?
                    </p>
                    <p className="mt-4">Découvrez-nous !</p>
                    <div className="text-center mt-5">
                      <NavLink to="/history" className="btn btn-white fadein">
                        Découvrir notre histoire
                      </NavLink>
                    </div>
                  </div>
                </div>
                <div className="col-12 col-lg-6 planet-img">
                  <img src="data:image/png;base64,
" alt="History image"/>
                </div>
              </div>
              <div className="row justify-content-center my-5 section">
                <div className="col-12 col-lg-6">
                  <div className="p-5 text-center section-infos">
                    <p className="mb-4">Une question, envoyez là nous !</p>
                    <a onClick={ this.sendMessage } href="javascript:void(0);" className="btn btn-white fadein">
                      Message
                    </a>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
        <Footer/>
        { localStorage.getItem('cookie') === 'oui' &&
          <div className="cookie p-1 text-center">
            <span className="text mx-5">
              Attention ce site utilise des cookies !
              <a href="https://www.subdelirium.com/generateur-de-mentions-legales/" target="_blank" className=" mx-5 fadein">
                Voir les mentions légales.
              </a>
            </span>
            <a onClick={ this.closeCookie } href="javascript:void(0);" className="btn btn-violet fadein mx-5">Fermer</a>
          </div>
        }
      </section>
    );
  }
}

export default Home;
